import React from 'react'
import store from './store'

export default function NoteContainer(props) {
  return(
    <section className="NoteContainer"> 
      <ul>
        {props.notes.map(note => 
          <li key={note.id}>
            <Note 
              id={note.id}
              name={note.name}
              modified={note.modified}
            />
          </li>
          )}
      </ul>
    </section>
  )
}


